[[module css]]
@import url('https://fonts.googleapis.com/css2?family=Linefont:wght@150');

:root:lang(cn) {
  --pale-accent: 17,102,221;
  --medium-accent: 44,46,100;
  --dark-accent: 15,3,100;
  --alt-accent: 17,102,221;
  --visited-link-color: var(--alt-accent);
  --swatch-background: 0,0,50;
  --background-gradient-color: 0,0,50;
  --header-gradient-color-bottom: 0,0,50;
  --dark-gray-monochrome: 10,10,60;
