}

.container > *:not(.archive, .footage) {
  display: none;
}

.illegible, #header :is(h1 a, h2 span), #page-title, .archive__heading p {
  --title-font: Linefont;
  font-family: Linefont;
  font-size: 200%;
  text-align: center;
  word-spacing: 1rem;
  text-wrap: balance;
}

.illegible :is(p, span) {
  line-height: 1;
}

.illegible em {
  font-family: Inter, sans-serif;
  font-style: normal;
  font-weight: 200;
  letter-spacing: -0.07em;
  transform: scaleY(0.8);
  display: inline-block;
  word-spacing: initial;
}

.interrogation {
  margin-block: 3rem;
  display: flex;
  flex-direction: column;
  align-items: center;
}
.interrogation::before, .interrogation::after {
  content: "";
  border-left: thin solid white;
  order: 2;
  height: 1rem;
}
.interrogation::after {
  order: 4;
}
.interrogation__input, .interrogation__output {
  border: thin solid white;
  padding: 1rem 2rem;
  order: 1;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 1rem 2rem;
  text-align: center;
}
.interrogation__process:where(:not(:first-child)) {
  order: 3;
  max-width: 8rem;
}
.interrogation__process--box {
  border: medium solid white;
  padding: 1rem 2rem;
  max-width: none;
}
.interrogation__output {
  order: 5;
}
[[/module]]

[[module css]]
#page-title {
  display: none;
}
